import React from 'react';
import './AppNovi.css';
import LargeButton from "./LargeButton";
import Header from "./Header";
import Title from "./Title";
import InputField from "./InputField";
import Footer from "./Footer";
import PhoneImage from "./PhoneImage";
import Item from "./Item";
import SearchBar from "./SearchBar";
import { Route, Link, BrowserRouter as Router } from 'react-router-dom';

class App extends React.Component {
  constructor() {
    super();
    this.state = {

    }
    this.handleClickRegistration = this.handleClickRegistration.bind(this);
    this.handleClickLogIn = this.handleClickLogIn.bind(this);
  }
  handleClickRegistration() {

  }
  handleClickLogIn() {

  }
  render() {
    return (
      <Router>
        <Route exact path="/" Component = {App}/>
        <Route path="/about" render={
          ()=>{
            return(
              <div>
                <p>This is the about page :D</p>
              </div>
            );
          }
        }></Route>
        <div>
          <div id="content-wrapper">
            <div id="titles">

              <Title
                fontSize="140px"
                fontWeight="lighter"
                color="#666666"
                text="#TECH"
                marginTop="0px"
              />
              <Title
                fontSize="40px"
                fontWeight="lighter"
                color="#b2b2b2"
                text="New thinking. New #tech."
                marginTop="-100px"
              />

            </div>
            <div id="sideContent">
              <div>
                <PhoneImage width="570px" height="50%" />
              </div>
              <div id="inputs">
                <Title
                  fontSize="50px"
                  fontWeight="bold"
                  color="#666666"
                  text="W E L C O M E"
                />
                <div>
                  <InputField type="text" width="450px" height="50px" placeholder="Email" />
                </div>
                <div>
                  <InputField type="password" width="450px" height="50px" placeholder="Password" />
                </div>
                <a href="">New user? Register here.</a>

                <div>
                  <LargeButton
                    fontSize="20px"
                    value="LOG IN"
                    width="200px"
                    height="50px"
                    borderRadius="10px"
                    backgroundColor="#2d2d2d"
                    borderColor="#2d2d2d"
                    hoverColor="pink"
                    handleClick={this.handleClickLogIn}
                  />
                </div>
              </div>
            </div>
          </div>
          <Footer
            height="60px"
            iconSize="30px"
          />
        </div>
      </Router>
    );
  }

}

export default App;
